import React from 'react';
import Panel from './Panel';


const PanelList = ({ pokedex, cardIndex }) => {
    const PanelCompon = pokedex.map((pokemon, i) => {
        return <Panel panelId={i} id={pokedex[i].id} name={pokedex[i].name} types={pokedex[i].types}/>
    })
    console.log(cardIndex);
    return (
        <div>
            {PanelCompon}
        </div>
    );
}

export default PanelList;
